export class LoggingInterceptor implements HttpInterceptor {
  intercept(req: HttpRequest<any>, next: HttpHandler): Observable<HttpEvent<any>> {
    console.log('Requisição HTTP:', req.url, req.method, req.body);
    return next.handle(req).pipe(
      tap(event => {
        if (event instanceof HttpResponse) {
          console.log('Resposta HTTP:', event);
        }
      }),
      catchError(err => {
        console.error('Erro na requisição:', err);
        return throwError(err);
      })
    );
  }
}

/* Слушатель коммандного порта */

package comm

import (
	"log"
	"net"
	"net/http"
	"strconv"
	"strings"
)

type ListenerCommandPort struct {
	port                int
	eventListener       func([]byte, int, net.PacketConn, net.Addr)
	eventTcpListener    func(w http.ResponseWriter, r *http.Request)
	eventSecureListener func(w http.ResponseWriter, r *http.Request)
	destroyCallback     func([]byte, int)
	connection          net.PacketConn
	tcpConnection       net.Conn
}

/*
set UDP listener for mails from command port
listener must take in PaketData aka []byte and PacketData len as int
net.PacketConn - commandport connection socket
*/

func (s *ListenerCommandPort) SetEventListener(fn func([]byte, int, net.PacketConn, net.Addr)) {
	s.eventListener = fn
}

/*
set TCP listener for mails from command port
listener must take in PaketData aka []byte and PacketData len as int
*/

func (s *ListenerCommandPort) SetTcpEventListener(fn func(w http.ResponseWriter, r *http.Request)) {
	s.eventTcpListener = fn
}

/*
set TCP listener for mails from command port
listener must take in PaketData aka []byte and PacketData len as int
*/

func (s *ListenerCommandPort) SetSecureEventListener(fn func(w http.ResponseWriter, r *http.Request)) {
	s.eventSecureListener = fn
}

/*
set listener for drop command port
listener must take in PaketData aka []byte and PacketData len as int
*/

func (s *ListenerCommandPort) SetDestroyCallback(fn func([]byte, int)) {
	s.destroyCallback = fn
}

/*
	Instance of commandPort listener

	port must be range 8000 to 50000
	netType must be udp (std udp socket) or tcp (http server) or secure (https server)
*/

func (s *ListenerCommandPort) RunListen(port int, netType string) {

	/* Защита от неверных значений */

	if port < 8000 || port > 50000 {
		port = 8080
	}

	if netType != "udp" && netType != "tcp" {
		netType = "udp"
	}

	s.port = port

	if netType == "udp" {
		/* listen for messages on commandPort */

		conn, err := net.ListenPacket(netType, "0.0.0.0:"+strconv.Itoa(port))
		s.connection = conn

		if err != nil {
			log.Fatal("Unable to create UDP connection: ", err)
		} else {
			log.Println("[comm] Listen udp command port as" + strconv.Itoa(port) + " listening commands.")

			/* start listening */
			s.listen()
		}

	} else if netType == "tcp" {
		http.HandleFunc("/SETUP", func(w http.ResponseWriter, r *http.Request) {
			s.eventTcpListener(w, r)
		})
		http.HandleFunc("/TEARDOWN", func(w http.ResponseWriter, r *http.Request) {
			buf := make([]byte, 2048)
			n, _ := r.Body.Read(buf)
			s.destroyCallback(buf, n)
		})
		http.ListenAndServe(":"+strconv.Itoa(port), nil)
	} else if netType == "secure" {
		http.HandleFunc("/SETUP", func(w http.ResponseWriter, r *http.Request) {
			s.eventTcpListener(w, r)
		})
		http.HandleFunc("/TEARDOWN", func(w http.ResponseWriter, r *http.Request) {
			buf := make([]byte, 2048)
			n, _ := r.Body.Read(buf)
			s.destroyCallback(buf, n)
		})
		//http.Serve(autocert.NewListener("example.com"), nil)
		http.ListenAndServeTLS(":"+strconv.Itoa(port), "cert.pem", "key.pem", nil)
	}
}

/* incoming logic */

func (s *ListenerCommandPort) listen() {

	defer s.connection.Close()

	buf := make([]byte, 2048)
	for {

		/* Read PacketData */

		n, addr, err := s.connection.ReadFrom(buf)

		if err != nil {
			break
		}

		/* Send packet to listener */

		/* Supports only: SETUP or TEARDOWN */

		if strings.Contains(string(buf[:]), "TEARDOWN") {
			if s.eventListener != nil {
				s.destroyCallback(buf, n)
			} else {
				log.Println("[comm] destroyCallback is not defined yet.")
			}
		} else if strings.Contains(string(buf[:]), "SETUP") {
			if s.eventListener != nil {
				go s.eventListener(buf, n, s.connection, addr)
			} else {
				log.Println("[comm] EventListener is not defined yet.")
			}
		} else {
			log.Println("[comm] Unsupported packetType.")
			s.connection.WriteTo(nil, addr)
		}
	}
	log.Println("[comm] Command port " + strconv.Itoa(s.port) + " down.")

}

function onEditInstallable(e) {
  // 1. PASTE YOUR n8n WEBHOOK URL HERE
  const WEBHOOK_URL = "https://your-n8n-test-workflow-URL-here";
  
  // Check if event object exists
  if (!e) {
    Logger.log("No event object received");
    return;
  }
  
  // Additional safety checks
  if (!e.range || !e.source) {
    Logger.log("Invalid event object - missing range or source");
    return;
  }
  
  // This check is crucial: it prevents the script from running incorrectly.
  // Check if the edit happened on the last row of the sheet (new row).
  if (e.range.getRow() == e.source.getActiveSheet().getLastRow()) {
    
    Logger.log("onEdit trigger fired successfully. Sending webhook...");
    
    try {
      // Get the data from the newly added row
      const sheet = e.source.getActiveSheet();
      const row = sheet.getRange(e.range.getRow(), 1, 1, sheet.getLastColumn()).getValues()[0];
      
      // Create a data payload to send to n8n
      const payload = {
        sheetName: sheet.getName(),
        row: row,
        timestamp: new Date().toISOString(),
        editInfo: {
          range: e.range.getA1Notation(),
          rowIndex: e.range.getRow(),
          columnIndex: e.range.getColumn()
        }
      };
      
      // Prepare the options for the webhook request
      const options = {
        method: "POST",
        headers: {
          "Content-Type": "application/json"
        },
        payload: JSON.stringify(payload)
      };
      
      // Send the data to your n8n webhook
      const response = UrlFetchApp.fetch(WEBHOOK_URL, options);
      
      // Log the response for debugging
      Logger.log("Webhook response status: " + response.getResponseCode());
      Logger.log("Webhook response: " + response.getContentText());
      
    } catch (error) {
      Logger.log("Error sending webhook: " + error.toString());
    }
  }
}

// Keep the simple trigger as backup (but it won't work for external requests)
function onEdit(e) {
  Logger.log("Simple onEdit trigger fired - but cannot make external requests");
  Logger.log("Use the installable trigger instead by running setupTrigger()");
}

