/************************************
 * AI ADS SHEET – Kod.gs
 * - QUESTION bias for Headliners (periodic tests disabled)
 * - HOOK style rotation (Q/COMMAND/NUMBER) + 5–7 word base clamp
 * - Diagnostics to "DEBUG"
 * - Tolerant parser + local fallbacks
 * - Writes Ads/Headline/Description to H15–J15 (overwrite each run)
 ************************************/
const OPENAI_API_KEY = "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";

/** Debug verbosity: set to true only if you want the full JSON response written to DEBUG */
const DEBUG_VERBOSE = false;

/** Output behavior */
const OVERWRITE_SINGLE_ROW = true; // Overwrite H15–J15 and clear below on every run

/** Prefer QUESTION headlines (set false to go back to rotation) */
const PREFER_QUESTION = true;
/** Optional periodic headline tests even when QUESTION is preferred
 *  >>> Disabled to force question-form Headliners every time <<<
 */
const PERIODIC_COMMAND_EVERY = 0;
const PERIODIC_NUMBER_EVERY  = 0;

/** Hook behavior */
const APPEND_OFFER_TO_HOOK = false;  // keep hook clean; prompt enforces an offer snippet
const INJECT_YOU_IN_HOOK = false;    // do not force "you-form" in HOOK

/** Offer snippets allowed in HOOK (assurance, not specs) */
const OFFER_ALLOWLIST = [
  "Snabb leverans",
  "Fri retur",
  "Fri frakt",
  "Skickas inom 24 h",
  "30-dagars garanti",
  "Betala med Klarna"
];

/** Forbidden/spec terms & risky claims to block/soften */
const FORBIDDEN_REGEX = /(naturlig(a)?|giftfri(t)?|ingredienser|kemikalier|LED|räknare|justerbart|material|mått|\bcm\b|gram|volt|impotens)/i;
/** Block numeric temperature specs like 200°, 200 grader, 200°C */
const TEMP_SPEC_REGEX = /\b\d{2,3}\s?(?:°\s?c|°c|°|grader)\b/i;
const QUANTIFIERS_REGEX = /\b(tusentals|hundratals)\b/ig;
const ABSOLUTES_REGEX = /\balla( typer)?\b/ig;

/** Extra guards to keep bullets “benefit-only” **/
const SPEC_LIKE_REGEX = /\b(beläggning|teknik|teknologi|konstruktion|design|induktion|diameter|storlek|mått|cm|pfas|ptfe|temperatur|°c|grader|material|stål|aluminium|kisel|keramik)\b/i;
const LOGISTICS_OR_CTA_REGEX = /\b(fri frakt|snabb leverans|skickas|garanti|retur|klarna|klicka|börja|testa|shoppa|skicka|ta första|se själv|upplev)\b/i;

/** Whitelist borrowed/accepted terms that must NOT be blocked as specs */
const ALLOWED_TERMS = [
  "non-stick", "nonstick", "non stick",
  "non-stick-yta", "nonstick-yta", "non stick yta",
  "stick-resistant", "non-stick coating", "nonstick coating"
];
function containsAllowedTerm(s) {
  const t = (s || "").toLowerCase();
  return ALLOWED_TERMS.some(w => t.includes(w.toLowerCase()));
}
function isForbiddenLine(s) {
  if (containsAllowedTerm(s)) return false;
  if (TEMP_SPEC_REGEX.test(s || "")) return true;
  return FORBIDDEN_REGEX.test(s || "");
}
function isSpecLike(s) {
  if (!s) return false;
  if (containsAllowedTerm(s)) return false;
  if (TEMP_SPEC_REGEX.test(s)) return true;
  return SPEC_LIKE_REGEX.test(s);
}
function isLogisticsOrCTA(s) { return LOGISTICS_OR_CTA_REGEX.test(s || ""); }
/** Final gate for bullets: must look like a benefit, not spec/logistics/CTA */
function isBenefitBulletLine(s) {
  if (!s) return false;
  if (isForbiddenLine(s)) return false;
  if (isSpecLike(s)) return false;
  if (isLogisticsOrCTA(s)) return false;
  return true;
}

/** Headline CTR helpers (prompt examples) **/
const HEADLINE_NUMBER_STARTERS = [
  "3 Ways to", "5 Secrets to", "7 Steps to", "50% Off", "Save X kr Today", "In Just 24 Hours"
];
const HEADLINE_COMMAND_STARTERS = [
  "Discover", "Upgrade", "Stop", "Start", "Get", "Try", "Unlock"
];

/** Headline rules section for prompt (100 chars, not 5–7 words) **/
function buildHeadlineRulesSection() {
  return [
    "HEADLINES (Störst CTR-påverkan):",
    "1) Längd: upp till 100 tecken, ≤1 emoji.",
    "2) Använd FRÅGEFORM (kan höja CTR markant) och tilltal i andra person ('du/dig/din/ni') där det låter naturligt.",
    "3) Testa stil: TAL (t.ex. '3 sätt att…', '50 % rabatt…', 'På 7 dagar…')",
    "   ELLER KOMMANDO (t.ex. 'Upptäck…', 'Sluta…', 'Uppgradera…', 'Få…', 'Prova…', 'Lås upp…').",
    "4) Rabatt/pris får endast nämnas i Headline (aldrig i Hook).",
    "5) Rotera mellan Tal/Kommando. Använd alltid lokalt språk i rubriker.",
    "   Tal-starters (eng. mallar – översätt): " + HEADLINE_NUMBER_STARTERS.join(", ") + ".",
    "   Kommando-starters (eng. mallar – översätt): " + HEADLINE_COMMAND_STARTERS.join(", ") + "."
  ].join("\\n");
}

/** Headline style rotation persisted in Script Properties (no sheet cell) */
const HEADLINE_STYLES = ["QUESTION","COMMAND","NUMBER"];
function getAndRotateHeadlineStylePersisted() {
  const props = PropertiesService.getScriptProperties();
  let cur = (props.getProperty("HEADLINE_STYLE") || "QUESTION").toUpperCase().trim();
  if (!HEADLINE_STYLES.includes(cur)) cur = "QUESTION";
  const next = HEADLINE_STYLES[(HEADLINE_STYLES.indexOf(cur) + 1) % HEADLINE_STYLES.length];
  props.setProperty("HEADLINE_STYLE", next);
  return "QUESTION"; // force question headliners
}

/** NEW: HOOK style rotation (Q/COMMAND/NUMBER) persisted in Script Properties */
const HOOK_STYLES = ["Q","COMMAND","NUMBER"];
function getAndRotateHookStylePersisted() {
  const props = PropertiesService.getScriptProperties();
  let cur = (props.getProperty("HOOK_STYLE") || "Q").toUpperCase().trim();
  if (!HOOK_STYLES.includes(cur)) cur = "Q";
  const use = cur;
  const next = HOOK_STYLES[(HOOK_STYLES.indexOf(cur) + 1) % HOOK_STYLES.length];
  props.setProperty("HOOK_STYLE", next);
  return use; // rotate each run: Q → COMMAND → NUMBER …
}

/** Run counter to allow periodic tests (still used for logging/metrics) */
function getRunCounterAndBump() {
  const props = PropertiesService.getScriptProperties();
  let n = parseInt(props.getProperty("RUN_COUNT") || "0", 10);
  if (isNaN(n)) n = 0;
  n += 1;
  props.setProperty("RUN_COUNT", String(n));
  return n;
}

/** DEBUG: write to a separate sheet */
function debugWrite(title, body) {
  const ss = SpreadsheetApp.getActiveSpreadsheet();
  let sh = ss.getSheetByName("DEBUG");
  if (!sh) sh = ss.insertSheet("DEBUG");
  const ts = new Date();
  const row = sh.getLastRow() + 1 || 1;
  sh.getRange(row, 1, 1, 3).setValues([[ts, title, body]]);
  sh.autoResizeColumns(1, 3);
}

/** Find next empty row in H–J (start writing well below your config area) */
const OUTPUT = { COL_AD: 8, COL_HL: 9, COL_DESC: 10, START_AT_ROW: 15 }; // start at row 15
function getNextOutputRow(sheet) {
  const start = OUTPUT.START_AT_ROW;
  const last = sheet.getMaxRows();
  for (let r = start; r <= last; r++) {
    const h = sheet.getRange(r, OUTPUT.COL_AD).getValue();
    const i = sheet.getRange(r, OUTPUT.COL_HL).getValue();
    const j = sheet.getRange(r, OUTPUT.COL_DESC).getValue();
    if (!h && !i && !j) return r;
  }
  return last + 1;
}

/** helper to clear output block when overwriting **/
function clearOutputArea(sheet) {
  const start = OUTPUT.START_AT_ROW;
  const rows = sheet.getMaxRows() - start + 1;
  if (rows > 0) sheet.getRange(start, OUTPUT.COL_AD, rows, 3).clearContent();
}

/** MAIN (DIAGNOSTIC) **/
function generateAds() {
  const ss = SpreadsheetApp.getActiveSpreadsheet();
  const sheet = ss.getSheetByName("AI ADS SHEET");
  if (!sheet) throw new Error('Saknar fliken "AI ADS SHEET".');

  const url = String(sheet.getRange("A2").getValue()).trim();
  if (!/^https?:\/\//i.test(url)) {
    debugWrite("WARN", "Ogiltig eller tom URL i A2: " + url);
  }

  // Headliners: always question (periodics disabled)
  let headlineStyle = getAndRotateHeadlineStylePersisted();

  // NEW: HOOK style rotation
  const hookStyle = getAndRotateHookStylePersisted();

 // ––––––––––––––––––––––––––––––––––––––––––––––––––––––––––
// Fetch the product page a single time
const html = UrlFetchApp.fetch(url, {
  muteHttpExceptions:    true,
  followRedirects:       true,
  validateHttpsCertificates: true
}).getContentText();
// Now reuse html for both extractors
const discount    = extractDiscountFromHtml(html);
const reviewQuote = extractRandomReviewQuoteFromHtml(html);


// ––––––––––––––––––––––––––––––––––––––––––––––––––––––––––

  const prompt = buildPrompt(
  url,
  discount,
  reviewQuote,
  headlineStyle,
  hookStyle
);


  debugWrite("INFO", "HeadlineStyle=" + headlineStyle + " | HookStyle=" + hookStyle + " | URL=" + url + " | Discount=" + discount);

  let response, code, body;
  try {
    response = UrlFetchApp.fetch("https://api.openai.com/v1/chat/completions", {
      method: "post",
      contentType: "application/json",
      headers: { Authorization: `Bearer ${OPENAI_API_KEY}` },
      payload: JSON.stringify({
        model: "gpt-4",
        messages: [
          { role: "system", content: prompt },
          { role: "user", content: `Skapa 1 annons med Ads, Headlines och Descriptions baserat på produktsidan: ${url}` }
        ],
        temperature: 0.7,
      } ),
      muteHttpExceptions: true,
    });
    code = response.getResponseCode();
    body = response.getContentText();
  } catch (e) {
    debugWrite("FETCH EXCEPTION", String(e));
    throw e;
  }

  debugWrite("OPENAI STATUS " + code, DEBUG_VERBOSE ? body : "(hidden)");
  if (code !== 200) throw new Error("OpenAI API error " + code + " – se DEBUG-arket.");

  let result, output;
  try {
    result = JSON.parse(body);
    output = result?.choices?.[0]?.message?.content || "";
  } catch (e) {
    debugWrite("JSON PARSE ERROR", String(e) + (DEBUG_VERBOSE ? "\nBODY:\n" + body : ""));
    throw new Error("JSON parse error – se DEBUG-arket.");
  }

  if (!output) {
    debugWrite("EMPTY MODEL OUTPUT", DEBUG_VERBOSE ? body : "(empty)");
    throw new Error("Tomt modelsvar – se DEBUG-arket.");
  }

  debugWrite("ASSISTANT CONTENT", output);

  // Parse tolerant
  const parsed = parseOutput(output);

  // Fallbacks if the model omitted sections
  if (!parsed.headline) parsed.headline = fallbackHeadlineFromAds(parsed.ads);
  if (!parsed.description) parsed.description = fallbackDescription();

  debugWrite(
    "PARSED",
    "Headline: " + (parsed.headline || "(fallback)") +
    " | Description: " + (parsed.description || "(fallback)")
  );

  // Clean + enforce (pass URL and hookStyle)
  const cleanedAds = cleanAdsStructure(parsed.ads || "", url, hookStyle);
  const safe = enforceOutputCaps({
    ad: cleanedAds,
    headline: parsed.headline || "",
    description: parsed.description || ""
  }, { headlineStyle, discount, url }); // pass url for headline brand scrub

  /** overwrite H15–J15 (and clear below) **/
  if (OVERWRITE_SINGLE_ROW) {
    clearOutputArea(sheet);
    const r = OUTPUT.START_AT_ROW; // 15
    sheet.getRange(r, OUTPUT.COL_AD).setValue(safe.ad || "");
    sheet.getRange(r, OUTPUT.COL_AD).setWrapStrategy(SpreadsheetApp.WrapStrategy.WRAP);
    sheet.getRange(r, OUTPUT.COL_HL).setValue(safe.headline || "");
    sheet.getRange(r, OUTPUT.COL_DESC).setValue(safe.description || "");
    sheet.getRange(r, OUTPUT.COL_HL, 1, 2).setWrap(true);
  } else {
    const destRow = getNextOutputRow(sheet);
    sheet.getRange(destRow, OUTPUT.COL_AD).setValue(safe.ad || "");
    sheet.getRange(destRow, OUTPUT.COL_AD).setWrapStrategy(SpreadsheetApp.WrapStrategy.WRAP);
    sheet.getRange(destRow, OUTPUT.COL_HL).setValue(safe.headline || "");
    sheet.getRange(destRow, OUTPUT.COL_DESC).setValue(safe.description || "");
    sheet.getRange(destRow, OUTPUT.COL_HL, 1, 2).setWrap(true);
  }
}

/** HELPERS: scraping **/
/**
 * @param {string} html  Full page HTML
 * @returns {string|null} e.g. "50 % rabatt" or "Spara 199 kr"
 */
function extractDiscountFromHtml(html) {
  try {
    // %-discount
    let pct = html.match(/(\d{1,2})\s?%/i);
    if (pct) {
      let n = parseInt(pct[1], 10);
      if (!isNaN(n) && n >= 5 && n <= 90) return `${n} % rabatt`;
    }

    // “spara X kr”
    let kr = html.match(/spara\s+(\d{2,5})\s?kr/i);
    if (kr) return `Spara ${kr[1]} kr`;

    // explicit 50%
    if (/(?:RABATT\s*|spara\s*)50 ?%/i.test(html)) return "50 % rabatt";
  } catch (e) {
    debugWrite("DISCOUNT SCRAPE ERROR", String(e));
  }
  return null;
}

/**
 * @param {string} html  Full page HTML
 * @returns {string|null} random review text
 */
function extractRandomReviewQuoteFromHtml(html) {
  try {
    let regex = /<div class="jdgm-rev__body">([\s\S]*?)<\/div>/gi;
    let matches = [], m;
    while ((m = regex.exec(html)) !== null) {
      let txt = m[1].replace(/<[^>]+>/g, "").trim();
      if (txt.length >= 10 && txt.length <= 150) matches.push(txt);
    }
    if (matches.length) {
      return matches[Math.floor(Math.random() * matches.length)];
    }
  } catch (e) {
    debugWrite("REVIEW SCRAPE ERROR", String(e));
  }
  return null;
}

/** PROMPT (unchanged except Headliners rules already reflect ≤100 chars) **/
/**
 * @param {string} url
 * @param {string|null} discount
 * @param {string|null} reviewQuote
 * @param {string} headlineStyle
 * @param {string} hookStyle      // e.g. "QUESTION", "NUMBER", "COMMAND", "EMOTION"
 * @returns {string}
 */
function buildPrompt(url, discount, reviewQuote, headlineStyle, hookStyle) {
   // —–––––  Inject dynamic hook guidance  –––––—
  let hookInstructions;
  switch (hookStyle) {
    case "QUESTION":
      hookInstructions =
        "Skriv en hook på exakt 5–7 ord som beskriver en fördel eller ett problem. " +
        "Avsluta med \" – [snutt]\".";
      break;
    case "NUMBER":
      hookInstructions =
        "Skriv en hook på exakt 5–7 ord som börjar med ett tal, t.ex. “3 sätt att lösa [problem]”. " +
        "Avsluta med \" – [snutt]\".";
      break;
    case "COMMAND":
      hookInstructions =
        "Skriv en hook på exakt 5–7 ord som börjar med ett verb (uppmaning), " +
        "t.ex. “Upptäck hur [produkt] förenklar livet”. Avsluta med \" – [snutt]\".";
      break;
    case "EMOTION":
      hookInstructions =
        "Skriv en hook på exakt 5–7 ord som väcker en känsla, " +
        "t.ex. “Frihet från [problem]”. Avsluta med \" – [snutt]\".";
      break;
    default:
      hookInstructions =
        "Skriv en hook på exakt 5–7 ord och avsluta med \" – [snutt]\".";
  }
  // —–––––  End injection  –––––—
}

  const headlineRules = buildHeadlineRulesSection();
  return `
Du är Sveriges främsta Facebook Ads-copywriter.
Skapa en (1) Facebook-annons **Ads**, en **Headline** och en **Description** för produkten på: ${url}

UTDATAFORMAT (MÅSTE):
