Headlines:
<en (1) rad>
Descriptions:
<en (1) rad>

${headlineRules}

DESCRIPTIONS:
- **Max 30 tecken**, max 1 emoji.
- Använd endast som trust-badge eller klarläggande (…).

Ads (primary text) - Mini-landing page:
- Front-load hook + offer inom de första 125 tecknen.
- Därefter: 4 bullets, Explain, Urgency/FAQ, Trust, CTA.

HOOK:
- Exakt 5-7 ord **före** “ - ” + en snutt.
- Använd fråga, tal eller uppmaning.

PRIMÄRTEXT (Ads) - Mini-landing page:
- **HOOK:** 5-7 ord, sedan “ - ” + en snutt. Max 125 tecken.  
  ${hookInstructions}  
- Tillåtna snuttar:  
  "Snabb leverans", "Fri retur", "Fri frakt",  
  "Skickas inom 24 h", "30-dagars garanti", "Betala med Klarna".

STRUKTUR FÖR Ads (MÅSTE FÖLJAS I ORDNING):
1) **HOOK** (1 rad) enligt ovan.  

2) **FYRA BULLETS** (4 rader exakt):  
   - Börja varje rad direkt med en emoji.
