/** PARSER – tolerant **/
function parseOutput(text) {
  const norm = (s) => (s || "").replace(/\r/g, "").trim();

  const adsMatch = text.match(/Ads:\s*([\s\S]*?)(?:\n\s*Headlines?:|\n\s*Descriptions?:|$)/i);
  const headlinesMatch = text.match(/Headlines?:\s*([\s\S]*?)(?:\n\s*Descriptions?:|$)/i);
  const descriptionsMatch = text.match(/Descriptions?:\s*([\s\S]*)/i);

  let ads = adsMatch ? norm(adsMatch[1]) : "";
  let headline = "";
  let description = "";

  if (headlinesMatch) {
    headline = norm(headlinesMatch[1].split("\n")[0].replace(/^"|"$/g, ""));
  }
  if (descriptionsMatch) {
    const lines = descriptionsMatch[1].split("\n").map(l => l.trim()).filter(Boolean);
    let desc = lines[0] || "";
    if (desc.length > 30) {
      let short = desc.substring(0, 30);
      let lastSpace = short.lastIndexOf(" ");
      desc = lastSpace > 0 ? short.substring(0, lastSpace) : short;
    }
    description = (desc || "").replace(/^"|"$/g, "").trim();
  }

  return { ads, headline, description };
}

/** FALLBACK BUILDERS **/
function extractHookLine(adText) {
  const lines = (adText || "").split(/\n/).map(s => s.trim()).filter(Boolean);
  return lines[0] || "";
}
function fallbackHeadlineFromAds(adText) {
  let hook = extractHookLine(adText).replace(/[.?!]+$/, "");
  if (!hook) return "Redo att uppgradera ditt kök?";
  let h = hook;
  if (!/[?]$/.test(h)) h = h + "?";
  return h.slice(0, 100).trim();
}
function fallbackDescription() {
  return "Fri retur. Skickas inom 24 h";
}

/** Cleaners & builders **/
function cleanAdsStructure(rawAds, url, hookStyle) {
  const allowedEmojis = ["✔","✅","💪","🌟","❤️","⭐","🎯","👍","🌍","🏆","🔒","🏠","🌬️","🍃","🤩","😃","😍","🎉","🦾","🤸","🔥","🦴"];
  const emojiRe = /[\p{Emoji_Presentation}\p{Extended_Pictographic}]/u;

  // Normalize → lines
  let lines = rawAds
    .replace(/\\\\n/g, "\n")
    .replace(/\\n/g, "\n")
    .split("\n")
    .map(l => l.replace(/^"|"$/g, "").trim())
    .filter(l => l.length > 0);

  // Strong de-dup
  const norm = s => s
    .toLowerCase()
    .replace(/[”″“]+/g, '"')
    .replace(/[’‘]+/g, "'")
    .replace(/[–—]+/g, "-")
    .replace(/\s+/g, " ")
    .trim();

  const seen = new Set();
  lines = lines.filter(l => {
    const key = norm(l);
    if (seen.has(key)) return false;
    seen.add(key);
    return true;
  });

  // Soften absolutes/quantifiers; sensitive terms
  lines = lines.map(l =>
    l.replace(QUANTIFIERS_REGEX, "många")
     .replace(ABSOLUTES_REGEX, "många")
     .replace(/impotens/ig, "sviktande närhet")
  );

  // HOOK (line 1) – normalize to one sentence with base 5–7 words + one snippet
  let hookRaw = lines[0] || "Upptäck skillnaden – förbättra din vardag!";
  let hookTmp = cleanHookFormatting(hookRaw);
  hookTmp = fixSvGrammar(hookTmp);
  const split = splitHookBaseAndSnippet(hookTmp);
  let base = enforceHookStyle(split.base, hookStyle);
  base = clampWords(base, 5, 7);
  let snippet = split.snippet || pickShortestOffer();
  let hook = attachSnippetWithinLimit(base, snippet, 125);
  hook = ensureSingleTerminal(hook, /\?\s*$/.test(base) ? "?" : "."); // keep single terminal

  // Collect bullets (benefits only)
  const bullets = [];
  const usedBulletKeys = new Set();

  for (const l of lines) {
    const startsWithEmoji = emojiRe.test(Array.from(l)[0] || "");
    if (!startsWithEmoji) continue;
    if (!isBenefitBulletLine(l)) continue;

    const cleaned = l.replace(/^[-–\s]+/, "");
    const benefitish = softenSpecishBullet(cleaned);
    const key = norm(benefitish);
    if (usedBulletKeys.has(key)) continue;

    if (benefitish.length <= 50) {
      bullets.push(benefitish);
      usedBulletKeys.add(key);
    } else {
      let cut = benefitish.slice(0, 50);
      const sp = cut.lastIndexOf(" ");
      cut = (sp > 0 ? cut.slice(0, sp) : cut).trim();
      if (cut) {
        bullets.push(cut);
        usedBulletKeys.add(key);
      }
    }
    if (bullets.length === 4) break;
  }

  // If <4 bullets, promote short safe lines into bullets
  if (bullets.length < 4) {
    for (const l of lines.slice(1)) {
      const startsWithEmoji = emojiRe.test(Array.from(l)[0] || "");
      if (startsWithEmoji) continue;
      if (!isBenefitBulletLine(l)) continue;
      if (l.length > 50) continue;

      const key = norm(l);
      if (usedBulletKeys.has(key)) continue;
      const em = allowedEmojis[bullets.length % allowedEmojis.length];
      bullets.push(em + " " + softenSpecishBullet(l));
      usedBulletKeys.add(key);
      if (bullets.length === 4) break;
    }
  }

  // Pad with safe fallbacks to exactly 4 bullets
  const fallbackBullets = [
    "💡 Enkel att komma igång med",
    "🏠 Fungerar hemma och på resan",
    "🤩 Rekommenderad av många användare",
    "✨ Resultat som märks snabbt"
  ];
  let fb = 0;
  while (bullets.length < 4 && fb < fallbackBullets.length) {
    const b = fallbackBullets[fb++];
    const key = norm(b);
    if (!usedBulletKeys.has(key)) {
      bullets.push(b);
      usedBulletKeys.add(key);
    }
  }
  if (bullets.length > 4) bullets.length = 4;

  // Scan remaining for explain/trust/cta
  const bulletSet = new Set(bullets.map(norm));
  let explain = "";
  let trust = "";
  let cta = "";

  for (let i = 1; i < lines.length; i++) {
    const l = lines[i];
    if (bulletSet.has(norm(l))) continue;

    const startsWithEmoji = /[\p{Emoji_Presentation}\p{Extended_Pictographic}]/u.test(Array.from(l)[0] || "");
    if (!explain && !startsWithEmoji && !isForbiddenLine(l)) {
      explain = l;
      continue;
    }
    if (!trust && (/[\"”“]/.test(l) || /garanti|kund/i.test(l))) {
      trust = l;
      continue;
    }
    if (!cta && /klicka|börja|testa|ge kroppen|se själv|ta första|skicka|upptäck|shoppa|upplev/i.test(l)) {
      cta = l;
      continue;
    }
  }

  // Build URGENCY/FAQ line
  let urgencyFaq = buildUrgencyOrFAQLine(lines);

  if (!explain) explain = "Från problem till kontroll – börja i dag.";
  if (!urgencyFaq) urgencyFaq = buildUrgencyOrFAQLine([]);
  if (!trust) trust = "30-dagars garanti. Prova hemma i lugn och ro.";
  if (!cta) cta = "Klicka hem din idag!";

  // Final assembly
  let adOut = [hook, ...bullets, "", explain, urgencyFaq, trust, cta].join("\n");
  adOut = neutralizeBrandTokens(adOut, url);
  return adOut;
}

/** HOOK helpers **/
function capHookLength(s, max) {
  if (!s) return s;
  if (s.length <= max) return s;
  let cut = s.slice(0, max);
  const lastSpace = cut.lastIndexOf(" ");
  if (lastSpace > 0) cut = cut.slice(0, lastSpace);
  return cut.trim();
}
function cleanHookFormatting(hook) {
  if (!hook) return hook;
  let s = hook.replace(/\s*•\s*/g, " ").trim();
  const idxQ = s.indexOf("?");
  const idxE = s.indexOf("!");
  const idxP = s.indexOf(".");
  let idx = [idxQ, idxE, idxP].filter(i => i >= 0).sort((a,b)=>a-b)[0];
  if (idx !== undefined) s = s.slice(0, idx + 1);
  s = s.replace(/[–—\-:,•]+$/,"").trim();
  return s;
}
function ensureHookHasYou(hook) { return hook; }
function hookHasOffer(text) {
  return /\b(fri retur|fri frakt|snabb leverans|skickas inom 24 ?h|30-?dag(ar|ars)\s+garanti|livstidsgaranti|öppet köp|betala med klarna|klarna)\b/i.test(text || "");
}
function ensureHookHasOffer(hook) {
  if (!APPEND_OFFER_TO_HOOK) return hook;
  if (!hookHasOffer(hook)) {
    const snippets = [
      "Snabb leverans • Fri retur",
      "Fri retur • Snabb leverans",
      "Fri retur",
      "Snabb leverans",
      "30-dagars garanti"
    ];
    for (const snip of snippets) {
      const sep = /[.!?]$/.test(hook) ? " " : " – ";
      const candidate = hook + sep + snip;
      if (candidate.length <= 125) return candidate;
    }
    if (hook.length + 11 <= 125) return hook + " • Fri retur";
  }
  return hook;
}

/** NEW: split HOOK into base + snippet (first allowed snippet found) */
function splitHookBaseAndSnippet(hook){
  let found = "";
  let base = hook;
  for (const p of OFFER_ALLOWLIST) {
    const re = new RegExp("(?:\\s*[–—\\-,:]?\\s*)?\\b" + p.replace(/[.*+?^${}()|[\\]\\\\]/g, "\\$&") + "\\b","i");
    if (re.test(base)) {
      found = p;
      base = base.replace(re, "").replace(/\s{2,}/g," ").replace(/\s+[–—\-,:]\s*$/,"").trim();
      break;
    }
  }
  return { base: base, snippet: found };
}
function pickShortestOffer(){ return "Fri retur"; }

function attachSnippetWithinLimit(base, snippet, maxLen){
  if (!snippet) return capHookLength(base, maxLen);
  const sep = /[.!?]$/.test(base) ? " " : " – ";
  let candidate = (base || "").trim();
  const q = /\?\s*$/.test(candidate);
  if (q) candidate = candidate.replace(/\?\s*$/,"").trim();
  let out = candidate + sep + snippet;
  if (q) out += "?";
  if (out.length <= maxLen) return out;
  const budget = maxLen - (sep.length + snippet.length + (q ? 1 : 0));
  let trimmed = candidate.slice(0, Math.max(0, budget));
  const lastSpace = trimmed.lastIndexOf(" ");
  if (lastSpace > 0) trimmed = trimmed.slice(0, lastSpace);
  out = trimmed.trim() + sep + snippet + (q ? "?" : "");
  return out.trim();
}

/** NEW: enforce HOOK style on base text */
function enforceHookStyle(base, style){
  let s = (base || "").trim();
  if (!s) return s;

  if (style === "Q") {
    if (!/\?\s*$/.test(s)) s = s.replace(/[.!]?\s*$/,"") + "?";
    return s;
  }

  if (style === "COMMAND") {
    const hasVerbStart = /^(Upptäck|Uppgradera|Sluta|Börja|Få|Prova|Lås upp)\b/i.test(s);
    if (!hasVerbStart) s = "Upptäck " + s.charAt(0).toLowerCase() + s.slice(1).replace(/^[?!.\-–—,:;]+/,"");
    s = s.replace(/\?\s*$/,"").trim();
    return s;
  }

  if (style === "NUMBER") {
    const hasNumber = /\b(\d+|\d+\s?%)\b/.test(s);
    if (!hasNumber) s = "3 sätt att " + s.charAt(0).toLowerCase() + s.slice(1);
    s = s.replace(/\?\s*$/,"").trim();
    return s;
  }

  return s;
}

/** NEW: clamp words helper (for HOOK base) */
function clampWords(s, minW, maxW){
  if (!s) return s;
  const q = /\?\s*$/.test(s);
  let core = s.replace(/\?\s*$/,"").trim();
  let words = core.split(/\s+/).filter(Boolean);
  if (words.length > maxW) words = words.slice(0, maxW);
  core = words.join(" ");
  return core + (q ? "?" : "");
}

/** NEW: ensure a single final terminal ('.' or '?') */
function ensureSingleTerminal(s, terminal) {
  if (!s) return s;
  let core = String(s).trim().replace(/[.!?]+$/g, "");
  return (core + terminal).trim();
}

/** Small Swedish grammar tidy (generic) **/
function fixSvGrammar(s) {
  if (!s) return s;
  let out = s;
  out = out.replace(/\bTrött\s+din\b/gi, "Trött på din");
  out = out.replace(/\bTrött\s+ditt\b/gi, "Trött på ditt");
  out = out.replace(/\bTrött\s+dina\b/gi, "Trött på dina");
  out = out.replace(/\s{2,}/g, " ").replace(/\s+([?.!,])/g, "$1");
  return out.trim();
}

function buildUrgencyOrFAQLine(lines) {
  const candidates = [
    "Begränsat lager – leverans från idag.",
    "Kampanjen gäller en kort tid – passa på.",
    "FAQ: Fungerar det för nybörjare? Ja, enkelt att komma igång.",
    "FAQ: Tar det lång tid? Nej, du kommer igång på minuter."
  ];
  const set = new Set((lines || []).map(s => String(s).toLowerCase().trim()));
  for (const c of candidates) {
    if (!set.has(c.toLowerCase().trim())) return c;
  }
  return "Gäller nu – säkra din beställning idag.";
}

/* ============================
   HEADLINE "YOU"-FORM ENFORCERS
   (affects Headliners only)
   ============================ */
function hasSecondPerson(s){ return /\b(du|dig|ni|din|ditt|dina)\b/i.test(s||""); }

// Insert compact “din” early
function insertDinCompact(s){
  if (hasSecondPerson(s)) return s;
  const q = /\?\s*$/.test(s);
  let core = s.replace(/\?\s*$/,"").trim();
  let words = core.split(/\s+/);
  let idx = words.findIndex(w => /^[a-ö]+$/i.test(w) && w[0] === w[0].toLowerCase() && w.length >= 4);
  if (idx < 0) idx = 1;
  words.splice(Math.min(Math.max(idx,1), words.length), 0, "din");
  core = words.join(" ");
  return (q ? core + "?" : core);
}

// Replace last tokens with “för dig”
function replaceTailWithForDig(s){
  const q = /\?\s*$/.test(s);
  let core = s.replace(/\?\s*$/,"").trim();
  let words = core.split(/\s+/);
  if (words.length >= 2) words.splice(-2, 2, "för", "dig");
  else words.push("för","dig");
  core = words.join(" ");
  return (q ? core + "?" : core);
}

// Style-aware hard enforcement of second-person in the HEADLINE only (≤100 chars)
function ensureSecondPersonHardHeadline(s, {question=false}={}){
  if (hasSecondPerson(s)) return s.trim();

  const base = s.replace(/\?\s*$/,"").trim();

  // Try appending “för dig”
  let candidate = base + (question ? " för dig?" : " för dig");
  if (candidate.length <= 100) return candidate;

  // Compact insert “din …”
  candidate = insertDinCompact(base + (question ? "?" : ""));
  if (hasSecondPerson(candidate) && candidate.length <= 100) return candidate;

  // Swap tail to “för dig”
  candidate = replaceTailWithForDig(base + (question ? "?" : ""));
  if (hasSecondPerson(candidate) && candidate.length <= 100) return candidate;

  // Last resort: cap at 100
  candidate = base + (question ? "?" : "");
  return candidate.slice(0, 100).trim();
}

/** NEW: headline single-sentence + question + you-form */
function firstSentenceOnly(s){
  if (!s) return s;
  const parts = String(s).trim().split(/[.!?]+/);
  const first = (parts[0] || "").trim();
  return first;
}
function forceQuestionOneSentenceWithYou(h){
  if (!h) return h;
  let core = firstSentenceOnly(h);
  core = core.replace(/[.!?]+$/,"").trim() + "?";
  core = ensureSecondPersonHardHeadline(core, { question: true });
  if (core.length > 100) core = core.slice(0, 100).trim();
  core = ensureSingleTerminal(core, "?");
  return core;
}

/** ENFORCERS for headline/description **/
function enforceOutputCaps(parsed, opts = {}) {
  const style = (opts && opts.headlineStyle) || "QUESTION";
  const discount = (opts && opts.discount) || null;

  // HEADLINE – normalize style, grammar tidy, enforce 2nd person, then caps (≤100 chars, ≤1 emoji)
  if (parsed.headline) {
    parsed.headline = enforceHeadlineStyle(parsed.headline, style, discount);
    parsed.headline = fixSvGrammar(parsed.headline);

    const isQ = style === "QUESTION" || /\?\s*$/.test(parsed.headline);
    parsed.headline = ensureSecondPersonHardHeadline(parsed.headline, { question: isQ });

    // NEW: collapse to single sentence question with you-form
    parsed.headline = forceQuestionOneSentenceWithYou(parsed.headline);

    if ((parsed.headline.match(/[\p{Emoji_Presentation}\p{Extended_Pictographic}]/gu) || []).length > 1) {
      parsed.headline = stripEmojisBeyond(parsed.headline, 1);
    }
    if (parsed.headline.length > 100) {
      parsed.headline = parsed.headline.slice(0, 100).trim();
    }

    // NEW: brand scrub on Headline
    parsed.headline = neutralizeBrandTokens(parsed.headline, opts && opts.url ? opts.url : "");
  }

  // DESCRIPTION – ≤30 chars, ≤1 emoji, insurance-only
  if (parsed.description) {
    if (parsed.description.length > 30) {
      parsed.description = parsed.description.slice(0, 30).trim();
    }
    if ((parsed.description.match(/[\p{Emoji_Presentation}\p{Extended_Pictographic}]/gu) || []).length > 1) {
      parsed.description = stripEmojisBeyond(parsed.description, 1);
    }
    if (looksLikePriceOrLegal(parsed.description)) {
      parsed.description = "";
    }
    if (!parsed.description || !isInsuranceDescription(parsed.description)) {
      parsed.description = insuranceFallback();
    }
  }

  return parsed;
}

// --- Description intent guards ---
function looksLikePriceOrLegal(s) {
  return /\b(\d{1,3}\s?%|kr|\d{4,})\b/i.test(s) ||
         /\b(villkor|terms|juridik|moms|skatt|ce|certifikat)\b/i.test(s);
}
function isInsuranceDescription(s) {
  return /\b(fri retur|30-?dag(ar|ars)\s+garanti|livstidsgaranti|skickas inom 24 ?h|snabb leverans|fri frakt|betala med klarna|klarna)\b/i.test(s);
}
function insuranceFallback() {
  const opts = ["Fri retur", "30-dagars garanti", "Skickas inom 24 h", "Fri frakt", "Betala med Klarna"];
  return opts[Math.floor(Math.random() * opts.length)];
}

/** Headline style normalization **/
function enforceHeadlineStyle(headline, style, discount) {
  let h = headline.trim();
  const isQuestion = /\?\s*$/.test(h);
  const startsWithCommand = new RegExp("^(" + HEADLINE_COMMAND_STARTERS.join("|") + ")\\b","i").test(h);
  const hasNumber = /\b(\d+|%\b|\d+\s?%)\b/.test(h) || /rabatt/i.test(h);

  // Force question headliners
  if (!isQuestion) h = h.replace(/[.!]?\s*$/,"") + "?";

  // Optionally align with NUMBER/COMMAND for content (does not override the ?)
  if (style === "COMMAND" && !startsWithCommand && h.length + "Upptäck ".length <= 100) {
    h = "Upptäck " + h.charAt(0).toLowerCase() + h.slice(1);
  } else if (style === "NUMBER" && !hasNumber) {
    if (discount) {
      const lead = discount + ": ";
      if ((lead + h).length <= 100) h = lead + h;
    } else {
      const fallback = "3 sätt att ";
      if (!h.toLowerCase().startsWith("3 sätt att ") && (fallback.length + h.length) <= 100) {
        h = fallback + h.charAt(0).toLowerCase() + h.slice(1);
      }
    }
  }
  return h.slice(0, 100).trim();
}

function stripEmojisBeyond(text, maxCount) {
  const chars = Array.from(text);
  let count = 0;
  return chars.map(ch => {
    const isEmoji = /[\p{Emoji_Presentation}\p{Extended_Pictographic}]/u.test(ch);
    if (!isEmoji) return ch;
    count += 1;
    return count <= maxCount ? ch : "";
  }).join("");
}

/** NEW: soften spec-ish bullets into benefit phrasing */
function softenSpecishBullet(line){
  let s = String(line || "");
  s = s.replace(/\brevolutionerande\s+non[-\s]?stick(?:\s+teknologi)?/ig, "maten släpper lätt");
  s = s.replace(/\bnon[-\s]?stick(?:\s*-?beläggning)?/ig, "maten fastnar mindre");
  s = s.replace(/\binduktions?(?:häll|komfur)?/ig, "fungerar i många kök");
  return s;
}

/** Neutralize product/brand names (Ads & Headliners) **/
function guessBrandFromUrl(url){
  try {
    const host = String(url || "").replace(/^https?:\/\//i,"").split("/")[0] || "";
    return (host.split(".")[0] || "").toLowerCase();
  } catch(e){ return ""; }
}
function neutralizeBrandTokens(text, url){
  if (!text) return text;
  let out = text;

  const brand = guessBrandFromUrl(url);
  if (brand) {
    const reDomain = new RegExp("\\b" + brand.replace(/[.*+?^${}()|[\\]\\\\]/g, "\\$&") + "\\b", "ig");
    out = out.replace(reDomain, "pannan");
  }

  const variants = [
    /the\s*hybrid\s*pan/ig,
    /hybrid\s*pan/ig,
    /the-?hybrid-?pan/ig,
    /\bTheHybridPan\b/ig,
    /\bHybridPan\b/ig
  ];
  variants.forEach(re => { out = out.replace(re, "pannan"); });

  out = out.replace(/\b[A-ZÅÄÖ][a-zåäö]+(?:[A-ZÅÄÖ][a-zåäö]+){1,}\b/g, "pannan");

