/** HELPERS: scraping **/
function extractDiscountFromPage(url) {
  try {
    if (!/^https?:\/\//i.test(url)) return null;
    const html = UrlFetchApp.fetch(url, {
      muteHttpExceptions: true,
      followRedirects: true,
      validateHttpsCertificates: true
    }).getContentText();

    const pct = html.match(/(\d{1,2})\s?%/i);
    if (pct) {
      const n = parseInt(pct[1], 10);
      if (!isNaN(n) && n >= 5 && n <= 90) return `${n} % rabatt`;
    }

    const saveKr = html.match(/spara\s+(\d{2,5})\s?kr/i);
    if (saveKr) return `Spara ${saveKr[1]} kr`;

    const match = html.match(/(?:RABATT\s*|spara\s*)50 ?%/i);
    if (match) return "50 % rabatt";
  } catch (e) {
    debugWrite("DISCOUNT SCRAPE ERROR", String(e));
  }
  return null;
}

function extractRandomReviewQuote(url) {
  try {
    if (!/^https?:\/\//i.test(url)) return null;
    const html = UrlFetchApp.fetch(url, {
      muteHttpExceptions: true,
      followRedirects: true,
      validateHttpsCertificates: true
    }).getContentText();

    const regex = /<div class="jdgm-rev__body">([\s\S]*?)<\/div>/gi;
    const matches = [];
    let m;
    while ((m = regex.exec(html)) !== null) {
      const cleaned = m[1].replace(/<[^>]+>/g, "").trim();
      if (cleaned.length >= 10 && cleaned.length <= 150) matches.push(cleaned);
    }
    if (matches.length > 0) return matches[Math.floor(Math.random() * matches.length)];
  } catch (e) {
    debugWrite("REVIEW SCRAPE ERROR", String(e));
  }
  return null;
}

