/** Neutralize product/brand names (Ads & Headliners) **/
function guessBrandFromUrl(url){
  try {
    const host = String(url || "").replace(/^https?:\/\//i,"").split("/")[0] || "";
    return (host.split(".")[0] || "").toLowerCase();
  } catch(e){ return ""; }
}
function neutralizeBrandTokens(text, url){
  if (!text) return text;
  let out = text;

  const brand = guessBrandFromUrl(url);
  if (brand) {
    const reDomain = new RegExp("\\b" + brand.replace(/[.*+?^${}()|[\\]\\\\]/g, "\\$&") + "\\b", "ig");
    out = out.replace(reDomain, "pannan");
  }

  const variants = [
    /the\s*hybrid\s*pan/ig,
    /hybrid\s*pan/ig,
    /the-?hybrid-?pan/ig,
    /\bTheHybridPan\b/ig,
    /\bHybridPan\b/ig
  ];
  variants.forEach(re => { out = out.replace(re, "pannan"); });

  out = out.replace(/\b[A-ZÅÄÖ][a-zåäö]+(?:[A-ZÅÄÖ][a-zåäö]+){1,}\b/g, "pannan");

  return out;
}

/** FEEDBACKLOG EXPORT (unchanged logic) **/
function extractProductCode(url) {
  url = url.replace(/^https?:\/\//, '').replace(/\/.*$/, '');
  var domain = url.split('.')[0];
  return domain.toUpperCase();
}
function generateVariantId(productUrl, feedbackSheet) {
  var productCode = extractProductCode(productUrl);
  var today = Utilities.formatDate(new Date(), Session.getScriptTimeZone(), "yyyy-MM-dd");
  var base = productCode + "-" + today + "-";
  var data = feedbackSheet.getRange("A2:A" + feedbackSheet.getLastRow()).getValues();
  var counter = 1;
  for (var i = 0; i < data.length; i++) {
    if (data[i][0] && data[i][0].startsWith(base)) {
      var n = parseInt(data[i][0].split("-").pop(), 10);
      if (!isNaN(n) && n >= counter) counter = n + 1;
    }
  }
  var id = base + (counter < 10 ? "0" : "") + counter;
  return id;
}
function kopieraAdsTillFeedbackLog() {
  const ss = SpreadsheetApp.getActiveSpreadsheet();
  const adsSheet = ss.getSheetByName("AI ADS SHEET");
  const feedbackSheet = ss.getSheetByName("FeedbackLog");

  const startRow = OUTPUT.START_AT_ROW;
  const lastRow = adsSheet.getLastRow();
  const numRows = lastRow - startRow + 1;
  if (numRows <= 0) return;

  const staticUrl = adsSheet.getRange("A2").getValue();
  const adsTexts = adsSheet.getRange(startRow, OUTPUT.COL_AD, numRows, 1).getValues();
  const headlines = adsSheet.getRange(startRow, OUTPUT.COL_HL, numRows, 1).getValues();
  const descriptions = adsSheet.getRange(startRow, OUTPUT.COL_DESC, numRows, 1).getValues();

  let dataToCopy = [];
  for (let i = 0; i < numRows; i++) {
    const ad = adsTexts[i][0];
    const headline = headlines[i][0];
    const description = descriptions[i][0];
    if (ad && headline && description) {
      const variantId = generateVariantId(staticUrl, feedbackSheet);
      dataToCopy.push([variantId, staticUrl, ad, headline, description, ""]);
    }
  }

  if (dataToCopy.length > 0) {
    const destStartRow = feedbackSheet.getLastRow() + 1;
    feedbackSheet.getRange(destStartRow, 1, dataToCopy.length, 6).setValues(dataToCopy);
  }
}

